import React from "react";
import styled from "styled-components";
import { SPACING } from "./Global Styles/styles";
import SearchBar from "./SearchBar";
import Card from "./Card";

const MainArea = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`;

const SearchBarArea = styled.div`
    margin: ${SPACING.large} 126px 0px 126px;
`;

const Main = () => {
    return(
        <MainArea>
            <SearchBarArea>
                <SearchBar />
            </SearchBarArea>
            <Card />
        </MainArea>
    );
}

export default Main;
